import Home from './home.js';
import React, { Component } from 'react';

//You can ignore this page. This is just for me to try out the filter function.

const list = [
    {
      title: 'Physics 100',
      url: 'https://dornsife.usc.edu/cf/faculty-and-staff/faculty.cfm?pid=1013055',
      content: 'intro physics',
      topic: 'electricity',
      ID: '01',
    },
    {
      title: 'Physics 151',
      url: 'https://dornsife.usc.edu/cf/phys/student_display.cfm?Person_ID=1056005',
      content: 'mechanics and thermodynamics',
      topic: 'entropy',
      ID: '02',
    },
    {
      title: 'CSCI 109',
      url: 'https://viterbi.usc.edu/directory/faculty/Goodney/Andrew',
      content: 'intro cs',
      topic: 'robotics',
      ID: '03',
    },
  ];

class Physics extends Component {  

    constructor(props){
        super(props);
        this.state = {
          list: list
        };
      }

    render () {
        const  physicslist  = this.state.list.filter(item => item.title.includes('Physics'));
        return (
            <div className='Physics'>
          {physicslist.map(function(item) {
            return (
              <div key={item.ID}>
                <span>
                  <a href={item.url}>{item.title}</a>
                </span>
                <div>{item.content}</div>
                <div>{item.topic}</div>
                </div>
            );
          })}
          </div>
         );
    }
}

export default Physics;
